import React, { Component } from 'react'
import image from "../Imagenes/general/Svg.png"
import { Div, Img } from "../styles/styles"

 class InterfaceExplored extends Component {
  render() {
    return (

        <Div>
            <Img src={image} alt=""  />
        </Div>  
    )
  }
}

export default InterfaceExplored;
